def show_plot(data):
    """
    draws pyplot of the rewards from data

    :param data: csv file path
    :return:
    """
    df = pd.DataFrame(pd.read_csv(data))

    scaler = preprocessing.MinMaxScaler(feature_range=(0, 100))
    d = scaler.fit_transform(df)
    scaled_df = pd.DataFrame(d, columns=df.columns)
    scaled_df["reward"].plot()
    scaled_df["rail length"].plot(alpha=0.5, c="red")

    z = np.polyfit(df["episode"], scaled_df["reward"], 1)
    p1 = np.poly1d(z)
    plt.plot(df["episode"], p1(df["episode"]), c="black")
    plt.legend(["", " ", " "])
    plt.xlabel(" ")
    plt.ylabel(" ")
    plt.title("  \n" + data)
    plt.show()

    z = np.polyfit(df["episode"], df["reward"], 1)
    p1 = np.poly1d(z)
    df["reward"].plot()
    plt.plot(df["episode"], p1(df["episode"]))
    plt.legend(["", " "])
    plt.xlabel(" ")
    plt.ylabel("")
    plt.title("   \n" + data)
    plt.show()

    z = np.polyfit(df["episode"], df["rail length"], 1)
    p1 = np.poly1d(z)
    df["rail length"].plot()
    plt.plot(df["episode"], p1(df["episode"]))
    plt.legend([" ", " "])
    plt.xlabel(" ")
    plt.ylabel(" ")
    plt.title("    \n" + data)
    plt.show()

